import React from 'react';
import './App.css';
import Navi from "./components/navbar";
import Jumbo from "./components/jumbotron";
import Carou from "./components/carousel";
import Gri from "./components/grid";
import Car from "./components/card";
import For from "./components/form";
import Foot from "./components/footer";

function App() {
  return (
    <div className="App">
      <Navi/>
      <Jumbo/>
      <Carou> 
        <h3> Education Carousel </h3>
      </Carou>
      <Carou> 
        <h3> Work Experience Carousel </h3>
      </Carou>
      <Carou> 
        <h3> Coding Languages Carousel </h3>
      </Carou>
      <Gri/>
      <Car/>
      <For/>
      <Foot/>
    </div>
  );
}

export default App;
